import React from "react";
import Layout from "./Layout";
import {Box, AppBar} from "@mui/material"

function Header() {
  return (
    <div>
    <Box>
        <AppBar>
          <p>My Restaurant</p>
        </AppBar>
    </Box>
    </div>
  );
}

export default Header;
